import "./movies.css";
import Smovies from "../components/smovie";
import { useState, useEffect } from "react";
const Movies = () => {
  const [data, setData] = useState(null);
  useEffect(() => {
    setTimeout(async () => {
      setData(Smovies);
      console.log(data);
    }, 3000);
  });
  return (
    <>
      <div>Movies</div>
      <div className="grid">
        <Smovies />
      </div>
    </>
  );
};

export default Movies;
